Descrição:
"Roupa Íntima Descartável TENA Pants Confort é uma roupa íntima descartável e unissex de rápida absorção, proporcionando ao usuário ativo ou com pouca mobilidade facilidade de uso, discrição e segurança.
É indicado para perdas de urina moderada a severa.
• Núcleo de Ultra Absorção Acquidry;
• Odour Neutralizer™ - Sistema que neutraliza o risco de odores indesejáveis;
• Material Macio - suave ao contato com a pele;
• Mais elásticos em volta da cintura permitindo uma adaptação perfeita ao corpo;
• Elásticos duplos nas pernas para um melhor conforto e segurança contra vazamentos;
• Costuras laterais removíveis para retirar o produto com maior facilidade."

