"As toalhas umedecidas Dry Baby foram especialmente desenvolvidas para a pele delicada do bebê. Além de limpar e remover as impurezas a cada troca de fralda, hidrata e protege contra assaduras.
• Composta de fibras de poliéster e viscose;
• Fórmula suave que não agride a pele do bebê;
• Lanolina Etoxilada - emoliente (evita ressecamento);
• Extrato de Aloe Vera - umectante e hidratante;
• Propilenoglicol - umectante, anti-microbiano e ajuda na hidratação da pele.
• Toque mais macio, carinho para a pele do bebê.
Seu bebê limpinho e protegido todos os dias."

"Absorvente para Incontinência Urinária TENA Lady Discreet Normal faz parte da linha TENA Lady Discreet, produtos exclusivos para mulheres com incontinência urinária.
Proteção diária para mulheres ativas com escapes de urina.
• Produto que você fixa na roupa íntima, evitando que ele se desloque com o movimento;
• Odour Control™ - sistema de controle que reduz o risco de odores indesejáveis;
• Dry Fast Core™ - núcleo de secagem rápida que absorve e retém o líquido mais rapidamente;
• Superfície com toque de tecido - para maior conforto e sensação de maciez;
• Embalagem individual - para maior conveniência e praticidade da usuária;
• Body Shape™ - laterais elásticas que permitem melhor ajuste ao corpo;
• Camada inferior respirável - para melhor circulação de ar e sensação de frescor.
• Absorve 3x mais que o absorvente menstrual garante segurança e excelente proteção contra vazamentos.
• Os componentes são atóxicos e pré-testados."

"Absorvente para Incontinência Urinária TENA Lady Discreet Maxi Night Noturno faz parte da linha TENA Lady Discreet, produtos exclusivos para mulheres com incontinência urinária.
Proteção diária para mulheres ativas com perda moderada de urina. TENA Lady Maxi Night foi especialmente projetado para proporcionar uma boa noite de sono.
São macias e confortáveis favorecendo proteção adicional devido ao seu formato específico: são mais largas na parte de trás com maior área de cobertura e extra absorção quando deitado.
• Produto que você fixa na roupa íntima, evitando que ele se desloque com o movimento;
• Possui sistema Odour Control™ - Sistema de controle que reduz o risco de odores indesejáveis;
• Dry Fast Core™ - Núcleo de secagem rápida que absorve e retém o líquido mais rapidamente;
• Superfície com toque de tecido - Maior conforto e sensação de maciez;
• Absorve 9x mais que o absorvente menstrual garante segurança e excelente proteção contra vazamentos.
• Os componentes são atóxicos e pré-testados."

"Absorvente para Incontinência Urinária TENA Lady Discreet Mini Plus faz parte da linha TENA Lady Discreet, produtos exclusivos para mulheres com incontinência urinária.
