• Tem controlador de odores - sistema que reduz o risco de odores indesejáveis;
• Tecnologia Dry fast core - núcleo de secagem rápida que absorve e retém o líquido mais rapidamente;
• Superfície com toque suave, maior conforto e sensação de maciez;
• Camada inferior respirável - para melhor circulação de ar e sensação de frescor.
• Impressão floral - para ressaltar feminilidade;
• Embalagem individual - para maior conveniência e praticidade das usuárias.
